	('ef2cbab8-9585-48a2-8ac1-cd13cfc0fc75', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/galletas_con_chispas_de_chocolate_1743872086776.jpeg', 15, 90, '2025-04-05 16:54:47.439576+00', '2025-04-15 15:33:18.540489+00', true, 'V''s Chocolate Chip Cookies', 'Galletas con Chispas de Chocolate de V', 'You can chop the walnuts in your Thermomix by setting **5 sec/speed 5**. You can shape the dough into balls and freeze them to bake later. When you''re ready to bake, theres no need to thaw them, simply preheat the oven to 150C and place the frozen dough balls directly on a parchment-lined baking sheet, leaving about 2 inches of space between each one. Bake until the edges are golden brown and the center is still soft.', 'Puedes picar la nueces en tu Thermomix programando **5 seg/vel 5.** Puedes formar bolitas con la masa y congelarlas para hornearlas despus. Cuando quieras hornearlas, no es necesario descongelarlas, simplemente precalienta el horno a 150C y colcalas directamente sobre una bandeja forrada con papel para hornear, dejando 5 cm de separacin entre cada una. Hornea hasta que los bordes estn dorados y el centro an suave.', NULL, NULL, NULL, NULL, 24, 'easy', NULL, NULL),
