	('761c0c0a-b2a3-4f42-a1fe-da72190fccb0', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/albondigas_en_salsa_de_jitomate_1744741089046.jpeg', 20, 45, '2025-04-15 18:18:09.773617+00', '2026-01-11 04:38:47.887717+00', false, 'Meatballs with tomato sauce', 'Albndigas en salsa de jitomate', 'To make your own ground meat, place 400 g of partially frozen beef, cut into chunks (3 cm), in the bowl and chop for 10-13 sec/speed 8. Cutting the meat into even-sized pieces will help achieve a uniform result. You can add 50 g of grated Parmesan cheese in step 2 for extra flavor. You can stuff your meatballs with hard-boiled egg or mozzarella cheese for a delicious variation.', 'Para hacer tu propia carne molida, coloca 400 g de carne de res parcialmente congelada y cortada en trozos (3 cm) en el vaso y pica 10-13 seg/vel 8. Cortar la carne en trozos de tamao uniforme ayudar a obtener un resultado homogneo. Puedes aadir 50 g de queso parmesano rallado en el paso 2.', NULL, NULL, NULL, NULL, 4, 'easy', NULL, NULL),
	('3fbebf1c-0ff1-4a16-a53c-f8a5ff02baa5', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/hummus_1744318149886.jpeg', 10, 15, '2025-04-10 20:49:10.986763+00', '2026-01-12 15:59:26.266428+00', true, 'Hummus', 'Hummus', 'You can replace tahini with the same amount of toasted sesame seeds. If you prefer a smoother texture, gradually add more water until you reach your desired consistency.', 'Puedes reemplazar el tahini por la misma cantidad de ajonjol tostado. Si quieres una textura ms lisa, aade agua poco a poco agua hasta obtener tu consistencia deseada.', NULL, NULL, NULL, NULL, 1, 'easy', NULL, NULL),
