	('6a160e6c-306b-4c2e-b913-3898aaa8e920', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/galleta_de_mantequilla.jpg', 20, 50, '2024-11-10 17:22:37.835926+00', '2024-11-10 17:22:37.835926+00', true, 'Butter Cookies', 'Galletas de mantequilla', 'In step 2, add other flavors such as vanilla sugar, lemon zest, orange zest, ground cinnamon, or chopped candied fruit.', 'En el paso 2, aada otros sabores como azcar de vainila, ralladura de limn, ralladura de naranja, canela molida o fruta confitada picada.', 'Oven, baking sheet and parchment paper, airtight container, cooling rack.', 'horno, charola y papel encerado, recipiente hermtico, rejilla', '[{"order": 1, "section": null, "instruction": "Preheat the oven to 180 C. Line a baking sheet with parchment paper and set aside."}, {"time": 20, "order": 2, "speed": 6, "section": null, "ingredients": ["wheat flour", "sugar", "unsalted butter", "egg", "baking powder"], "instruction": "Place the flour, sugar, butter, egg, and baking powder in the mixing bowl. Mix **20 sec. / speed 6**. (TIP*)", "temperature": null}, {"order": 3, "section": null, "instruction": "Place some sugar on a plate. Form a ball with a tablespoon of dough and dip one part of the dough ball into the sugar. Place it on the baking sheet and flatten it with a fork to form a round cookie (approx.  4 cm)."}, {"order": 4, "section": null, "instruction": "Repeat with the rest of the dough and bake for 15-20 minutes at 180 C or until slightly golden. Let cool on a cooling rack before serving or storing in an airtight container."}]', '[{"order": 1, "section": null, "instruction": "Precalienta el horno a 180 C. Cubre una charola de horno con papel encerado y reserva."}, {"time": 20, "order": 2, "speed": 6, "section": null, "ingredients": ["harina", "azcar", "mantequilla", "huevo", "polvo para hornear"], "instruction": "Coloca en el vaso la harina, el azcar, la mantequilla, el huevo y el polvo para hornear. Mezcla **20 seg. / vel. 6**. (TIP*)", "temperature": null}, {"order": 3, "section": null, "instruction": "Coloca un poco de azcar en un plato. Forma una bolita con una cucharada de masa y hunde una parte de la bolita de masa en el azcar.  Colcala en la charola de horno y aplana con un tenedor formando una galleta redonda (aprox.  4 cm). "}, {"order": 4, "section": null, "instruction": "Repite con el resto de la masa y hornea por 15-20 minutos a 180 C o hasta que doren ligeramente. Deja enfriar en una rejilla antes de servir o guardar en un recipiente hermtico."}]', 30, 'easy', '{"fat": "3 g", "fiber": "0 g", "protein": "1 g", "calories": "82 kcal", "carbohydrates": "12 g", "nutritional_info": "per 1 piece"}', '[{"order": 1, "section": null, "translations": {"en": {"instruction": "Preheat the oven to **180 C / 350 F**. Line a baking sheet with parchment paper and set aside."}, "es": {"instruction": "Precalienta el horno a **180 C / 350 F**. Cubre una charola de horno con papel encerado y reserva."}}}, {"order": 2, "section": null, "thermomix": {"time": 20, "speed": 6, "temperature": null, "temperatureUnit": null}, "translations": {"en": {"ingredients": ["wheat flour", "sugar", "unsalted butter", "egg", "baking powder"], "instruction": "Place the flour, sugar, butter, egg, and baking powder in the mixing bowl. Mix %thermomixParams%. (TIP*)"}, "es": {"ingredients": ["harina", "azcar", "mantequilla", "huevo", "polvo para hornear"], "instruction": "Coloca en el vaso la harina, el azcar, la mantequilla, el huevo y el polvo para hornear. Mezcla **20 seg. / vel. 6**. (TIP*)"}}}, {"order": 3, "section": null, "translations": {"en": {"instruction": "Place some sugar on a plate. Form a ball with a tablespoon of dough and dip one part of the dough ball into the sugar. Place it on the baking sheet and flatten it with a fork to form a round cookie (approx.  4 cm)."}, "es": {"instruction": "Coloca un poco de azcar en un plato. Forma una bolita con una cucharada de masa y hunde una parte de la bolita de masa en el azcar.  Colcala en la charola de horno y aplana con un tenedor formando una galleta redonda (aprox.  4 cm). "}}}, {"order": 4, "section": null, "translations": {"en": {"instruction": "Repeat with the rest of the dough and bake for **15-20 minutes** at **180 C / 350 F** or until slightly golden. Let cool on a cooling rack before serving or storing in an airtight container."}, "es": {"instruction": "Repite con el resto de la masa y hornea por **15-20 minutos** a **180 C / 350 F** o hasta que doren ligeramente. Deja enfriar en una rejilla antes de servir o guardar en un recipiente hermtico."}}}]'),
