	('10cadced-e31b-4846-a7ac-b20742068137', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/galletas_de_pasitas_de_ian_1743621257930.jpeg', 15, 90, '2025-04-02 19:14:18.422692+00', '2025-04-15 15:33:53.293767+00', true, 'Ian''s Raisin Cookies', 'Galletas de Pasitas de Ian', 'You can chop the walnuts in your Thermomix by setting **5 sec/speed 5**. You can shape the dough into balls and freeze them to bake later. When you''re ready to bake, there''s no need to thaw them, simply preheat the oven to 150C and place the frozen dough balls directly on a parchment-lined baking sheet, leaving about 2 inches of space between each one. Bake until the edges are golden brown and the center is still soft.', 'Puedes picar la nueces en tu Thermomix programando **4 seg/vel 5.** Puedes formar bolitas con la masa y congelarlas para hornearlas despus. Cuando quieras hornearlas, no es necesario descongelarlas, simplemente precalienta el horno a 150C y colcalas directamente sobre una bandeja forrada con papel para hornear, dejando 5 cm de separacin entre cada una. Hornea hasta que los bordes estn dorados y el centro an suave.', 'spoon, oven, baking tray, measuring spoons, parchment paper', 'cuchara, horno, charola para hornear, papel para hornear (encerado)', NULL, NULL, 24, 'easy', NULL, NULL),
	('8ef111aa-e965-42a4-a5be-6f7053c53269', '', 15, 240, '2024-11-10 17:22:37.835926+00', '2026-01-11 04:38:12.251781+00', false, NULL, 'Cochinita pibil', NULL, 'Sirva la cochinita pibil con cebollitas preparadas usando 3 chiles habaneros cortados en juliana, 1 cucharada de organo seco, 1 diente de ajo picado, 120 g de vinagre blanco, el jugo de 2 limones, 200 g de cebolla morada en juliana y sal al gusto. Deje marinar la salsa por lo menos 30 minutos antes de servir.', NULL, 'tazn', NULL, '[{"order": 1, "section": null, "instruction": "Coloque en el vaso el ajo, el organo, el achiote, la pimienta, el comino en polvo, el vinagre, el jugo de naranja, la cebolla y la sal, licue 30 seg/vel 8. Transfiera a un tazn y reserve."}, {"order": 2, "section": null, "instruction": "Coloque el tazn con el marinado sobre la tapa del vaso y pese la carne de cerdo en cubos. Mezcle y deje reposar en refrigeracin por 3 horas."}, {"order": 3, "section": null, "instruction": "Coloque en el vaso el aceite, la manteca de cerdo y la carne con la marinada, coloque el cestillo sobre la tapa en lugar del cubilete y cocine 40 min/100C//vel  ."}, {"order": 4, "section": null, "instruction": "Retire el cestillo y coloque el cubilete en su posicin, deshebre 5 seg//vel 4.5 y sirva caliente."}]', 6, 'easy', '{"fibra": "1.5 g", "grasa": "42.3 g", "sodio": "872.6 mg", "caloras": "7 kcal", "protena": "29.5 g", "carbohidratos": "7.6 g", "grasa saturada": "14.8 g", "inf. nutricional": "por 1 porcin"}', NULL),
	('411d8e8c-069c-43a6-af16-98b140dd53e0', 'https://zozskiqxdphmkuniahac.supabase.co/storage/v1/object/public/recipes/images/galletas_de_chispas_de_chocolate_1744741270282.jpeg', 30, 240, '2025-04-15 18:21:10.999739+00', '2026-01-11 04:38:46.100212+00', false, 'Chocolate Chip Cookies', 'Galletas de chispas de chocolate', 'You can make your cookies with nuts by using 360 g chocolate chips and 200 g of your preferred nuts. This recipe is perfect for making "Levain-style" cookiesjust shape each cookie into 150 g portions.', 'Puedes hacer tus galletas con nueces usando 360g de chispas de chocolate y 200 g de las nueces de tu preferencia. Esta receta es perfecta para hacer galletas tipo Levian, lo nico que necesitas es hacer cada galleta de 150g.', NULL, NULL, NULL, NULL, 20, 'easy', NULL, NULL),
	('f4b73b2c-43c2-4743-88fb-29ddd739efc0', '', 10, 60, '2024-11-10 17:22:37.835926+00', '2026-01-11 04:38:13.035957+00', false, NULL, 'Salpicn de res', NULL, '', NULL, 'tazn, platn para servir', NULL, '[{"order": 1, "section": null, "instruction": "Coloque en el vaso la lechuga romana y 1200 g de agua, pique 4 seg//vel 4. Transfiera a un tazn y desinfecte. Escurra el agua, coloque la lechuga en un platn y reserve hasta su uso."}, {"order": 2, "section": null, "instruction": "Coloque en el vaso el vinagre de vino blanco, el aceite de oliva extra virgen, la sal fina y la pimienta, mezcle 3 seg/vel 4. Transfiera a un recipiente y reserve."}, {"order": 3, "section": null, "instruction": "Coloque en el vaso la falda de res, 1100 g de agua, la cebolla y el ajo, cocine 55 min/100C//vel 1. Reserve el lquido de coccin para otra preparacin."}, {"order": 4, "section": null, "instruction": "Deshebre 5 seg//vel 5. Deje enfriar la carne."}, {"order": 5, "section": null, "instruction": "Coloque en el platn de la lechuga, el jitomate, la cebolla morada, la carne y la mezcla de vinagre y aceite. Mezcle con ayuda de la esptula."}, {"order": 6, "section": null, "instruction": "Sirva acompaado con rebanadas de aguacate y tostadas."}]', 6, 'easy', '{"fibra": "2 g", "grasa": "16 g", "caloras": "326 kcal", "protena": "23 g", "carbohidratos": "24 g", "inf. nutricional": "por 1 porcin"}', NULL);


