### Thermomix Banana Bread

#### Ingredients:
- 3 ripe bananas
- 100g unsalted butter, softened
- 150g brown sugar (or coconut sugar for a healthier option)
- 2 large eggs
- 1 tsp vanilla extract
- 200g all-purpose flour (or whole wheat flour)
- 1 tsp baking powder
- 1/2 tsp baking soda
- 1/4 tsp salt
- Optional: 100g chocolate chips or nuts (like walnuts or pecans)

#### Instructions:
1. **Preheat the Oven**: Preheat your oven to 180C (350F) and grease a loaf pan.

2. **Mix Bananas**: Place the ripe bananas in the mixing bowl and mash for 5 seconds on speed 4. Scrape down the sides.

3. **Add Butter & Sugar**: Add the softened butter and brown sugar. Mix for 20 seconds on speed 4.

4. **Add Eggs & Vanilla**: Add the eggs and vanilla extract. Mix for another 15 seconds on speed 4.

5. **Combine Dry Ingredients**: Add the flour, baking powder, baking soda, and salt. Mix for 20 seconds on speed 4, using the spatula to help combine if needed.

6. **Fold in Extras**: If using, fold in chocolate chips or nuts by mixing for 10 seconds on reverse speed 2.

7. **Bake**: Pour the batter into the prepared loaf pan and smooth the top. Bake for about 60 minutes or until a skewer inserted into the center comes out clean.

8. **Cool & Serve**: Let it cool in the pan for about 10 minutes, then transfer to a wire rack to cool completely. Enjoy!

Feel free to ask if you need any modifications or substitutions! Happy baking! ', NULL, NULL, 235, 401, '2026-01-13 04:52:49.482015+00'),
